import React from 'react';
import "./Main_header.css";

const Main_header = () => {
  return (
    <div className="header_wrapper">
        <div className="first_block">
            <p className="text_in_first_block">TEXT</p>
        </div>
    </div>
  );
};

export default Main_header;
